	add("nigger", "{\"term\":\"nigger\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Spanish\", \"French\", \"Italian\", \"Latin\", \"Portuguese\"], \"text\":\"Ultimately from Latin \u0027lang\u003dla|niger\u0027 () via Spanish {{m|es|negro}} or Portuguese {{m|pt|negro}}, which were borrowed into English during the time of the slave trade (see {{m|en|negro}}). In speech, \u0026quot;negro\u0026quot; was corrupted to \u0026quot;neggero\u0026quot; and then to simply \u0026quot;nigger\u0026quot;. Compare French {{m|fr|nègre}} and Italian {{m|it|negro}}, also borrowed Spanish (vs the inherited terms {{m|fr|noir}} and {{m|it|nero}}).\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A dark-skinned person, especially a person of, or primarily of, Negro descent; a black person\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"It was fifteen minutes before I could work myself up to go and humble myself to a \u0027\u0027nigger\u0027\u0027; but I done it, and I warn\u0027t ever sorry for it afterwards, neither\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"role \u003d Colonel Oliver passage \u003d You are not even a \u0027\u0027nigger\u0027\u0027, you are an African\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A person of Negro descent who acts in an unapproved manner, usually as an archetypical badass\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"title \u003d Chris Rock: Bring the Pain url \u003d http://www.imdb.com/title/tt0200529/ passage \u003d There\u0027s black people, and there\u0027s \u0027\u0027\u0027niggers\u0027\u0027\u0027. And \u0027\u0027niggers\u0027\u0027 have got to go. Every time black people wanna have a good time, ign\u0027ant-ass \u0027\u0027niggers\u0027\u0027 fuck it up\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"passage \u003d See, \u0027\u0027niggers\u0027\u0027 are followers, blacks normally lead. / \u0027\u0027Niggers\u0027\u0027 call blacks \u0026quot;whitewash\u0026quot; soon as they on the scene\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"2002\u0027\u0027, Earl Ofari Hutchinson, \u0026quot;Loaded Language\u0026quot;, a review of \u0027Nigger: The Strange Career of a Troublesome Word\u0027 by Randall Kennedy, \u0027Washington Post\u0027, Sunday, January 13, 2002; Page BW06\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"I had overheard him greet a buddy who called him on the phone with \u0026quot;Yo, \u0027\u0027nigger\u0027\u0027, what\u0027s up?\u0026quot\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A fish, the luderick\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"An impurity in the covering of an electrical conductor which serves to make a partial short circuit, and thus becomes sufficiently heated to burn and destroy the insulation\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"1892\u0027\u0027, \u0027Western Electrician\u0027 (volume 11, page 72\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"Now to locate the portion of the machine which contains the \u0026quot;\u0027\u0027nigger\u0027\u0027.\u0026quot\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"Holothuria nigra\u0027, the cotton spinner\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"A black caterpillar, the larva of the turnip sawfly\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"A strong iron-bound timber with sharp teeth or spikes protruding from its front face, forming part of the machinery of a sawmill, and used in canting logs, etc\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"A steam-capstan on some Mississippi river boats, used to haul the boat over bars and snags by a rope fastened to a tree on the bank\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"Goldenseal\u0027 (volume 9, page 20\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"Well, it\u0027s a big heavy line, and you operate the \u0027\u0027nigger\u0027\u0027 — capstan it\u0027s also called — by steam. You wrap your line around that and keep taking in the slack, and that draws up them things\", \"priority\":18}]}, \"synonyms\":{}}");

	add("niggeration", "{\"term\":\"niggeration\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|nigger|ation|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The quality of being niggerized\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1974\u0027\u0027, Ernest Brawley, \u0027The Rap\u0027, [http://books.google.com/books?id\u003duWlyAAAAMAAJ\u0026amp;q\u003dniggeration\u0026amp;dq\u003dniggeration\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003djsVpT5-0BIKQiALT_oDHBQ\u0026amp;ved\u003d0CEcQ6AEwBQ link\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Uncle Big Arv marched them out into the Isolation Yard and after a little racial disturbance out there, a few minutes of \u0027\u0027niggeration\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1981\u0027\u0027 April, \u0027Ebony\u0027, volume 36, number 6, [http://books.google.com/books?id\u003duEZZB0rlGrYC\u0026amp;pg\u003dPA16\u0026amp;dq\u003dniggeration\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003djsVpT5-0BIKQiALT_oDHBQ\u0026amp;ved\u003d0CDAQ6AEwAA page 16\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Ben Vereen, you ought to be tarred and feathered for the egotistical, insensitive, stereotypical \u0027\u0027niggeration\u0027\u0027 of yourself and all Black people\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, Susan Calhoun, \u0027Freeway Close\u0027, [http://books.google.com/books?id\u003d-kXQY5fHgGwC\u0026amp;pg\u003dPA43\u0026amp;dq\u003dniggeration\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003djsVpT5-0BIKQiALT_oDHBQ\u0026amp;ved\u003d0CDgQ6AEwAg page 43\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027niggeration\u0027\u0027 of America\", \"priority\":7}]}, \"synonyms\":{}}");

