	add("niggle", "{\"term\":\"niggle\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Norwegian\"], \"text\":\"First attested in 1599. Origin uncertain, but likely from Norwegian {{m|no|nigla}} and/or {{m|no|nigla}}. Possibly cognate to \u0027niggard\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A minor complaint or problem\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2012\u0027\u0027, The Guardian, \u0027[http://www.guardian.co.uk/sport/2012/jul/15/christian-taylor-philips-idowu-triple-jump1/print London 2012: Christian Taylor aims high as Phillips Idowu stays away]\u0027, by Anna Kesse\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The Olympic medal contender\u0027s back problem has been described as a \u0026quot;\u0027\u0027niggle\u0027\u0027\u0026quot; by the head coach, Charles van Commenee, but Porter\u0027s friend and former team-mate Danielle Carruthers revealed that the injury is playing on the Briton\u0027s mind\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Small, cramped handwriting\", \"priority\":4}]}, \"synonyms\":{}}");

	add("night", "{\"term\":\"night\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"Danish\", \"German\", \"Greek\", \"English\", \"middle english (1100-1500)\", \"West Frisian\", \"Icelandic\", \"Latin\", \"low german\", \"Dutch\", \"scots\", \"Swedish\"], \"text\":\"From Middle english (1100-1500) {{m|enm|night}}, {{m|enm|nyght}}, {{m|enm|niȝt}}, {{m|enm|naht}}, from Old english (ca. 450-1100) {{m|ang|niht}}, {{m|ang|neht}}, {{m|ang|nyht}}, {{m|ang|neaht}}, {{m|ang|næht||night}}, from Proto-germanic {{m|gem-pro|*nahts||night}}, from Proto-indo-european {{m|ine-pro|*nókʷts||night}}. Cognate with Scots {{m|sco|nicht}}, {{m|sco|neicht||night}}, West frisian {{m|fy|nacht||night}}, Dutch {{m|nl|nacht||night}}, Low german {{m|nds|Nacht||night}}, German {{m|de|Nacht||night}}, Danish {{m|da|nat||night}}, Swedish {{m|sv|natt||night}}, Icelandic {{m|is|nótt||night}}, Latin {{m|la|nox||night}}, Greek {{m|el|νύχτα||night}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The period between sunset and sunrise, when a location faces far away from the sun, thus when the sky is dark\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The Bat—they called him the Bat. Like a bat he chose the \u0027\u0027night\u0027\u0027 hours for his work of rapine; like a bat he struck and vanished, pouncingly, noiselessly; like a bat he never showed himself to the face of the day\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://www.theguardian.com/lifeandstyle/2013/jul/08/irregular-bedtimes-affect-childrens-brains Irregular bedtimes may affect children\u0027s passage\u003dIrregular bedtimes may disrupt healthy brain development in young children, according to a study of intelligence and sleeping habits.\u0026amp;nbsp; \u0026amp;para;\u0026amp;nbsp;Going to bed at a different time each \u0027\u0027night\u0027\u0027 affected girls more than boys, but both fared worse on mental tasks than children who had a set bedtime, researchers found\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"An evening or night spent at a particular activity\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://www.economist.com/news/international/21579039-chinas-growing-empire-ports-abroad-mainly-about-trade-not-aggression-new-masters The new masters and passage\u003dFrom the ground, Colombo’s port does not look like much. Those entering it are greeted by wire fences, walls dating back to colonial times and security posts. For mariners leaving the port after lonely \u0027\u0027nights\u0027\u0027 on the high seas, the delights of the B52 Night Club and Stallion Pub lie a stumble away\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A night (and part of the days before and after it) spent in a hotel or other accommodation\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Nightfall\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Darkness\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A dark blue colour, midnight blue\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"A night\u0027s worth of competitions, generally one game\", \"priority\":10}]}, \"synonyms\":{}}");

	add("nightbreak", "{\"term\":\"nightbreak\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The point at which night begins\", \"priority\":1}]}, \"synonyms\":{}}");

	add("nightcap", "{\"term\":\"nightcap\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|night|cap|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A warm cloth cap worn while sleeping, often with pajamas, being common attire in northern Europe before effective home heating became widespread\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Winston wore a \u0027\u0027nightcap\u0027\u0027 to stave off the cold\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A beverage drunk before bed that is usually alcoholic\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"I\u0027ll make myself a \u0027\u0027nightcap\u0027\u0027 of whisky and lemon before heading to bed\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Something the person reads or listens to before bed\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1920\u0027\u0027, https://books.google.com/books?id\u003dwAtiPPqkdJ8C\u0026amp;pg\u003dPR6\u0026amp;dq\u003d%22professorling%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ved\u003d0CB8Q6AEwAGoVChMImd-Dy-P0xwIVkZiICh1TPAn\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003dnightcap\u0026amp;f\u003dfalse Recreations of a Psychologis\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"quot; and as a \u0027\u0027nightcap\u0027\u0027 I happened to pick the copy of Plato \u0026quot\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"The final match of a sporting contest, especially the second game of a baseball doubleheader\", \"priority\":9}]}, \"synonyms\":{}}");

	add("nightclub", "{\"term\":\"nightclub\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From English.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A public or private establishment that is open late at night to provide entertainment, food, drink, music and/or dancing\", \"priority\":1}]}, \"synonyms\":{}}");

	add("nightcrawler", "{\"term\":\"nightcrawler\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|night|crawler|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An earthworm of the species , known for its large size and nocturnal surfacings\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"More generally, any arbitrarily large earthworm, especially those favored in angling\", \"priority\":2}]}, \"synonyms\":{}}");

	add("nightdream", "{\"term\":\"nightdream\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{compound|night|dream|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A dream that is experienced at night, sometimes as distinguished from a daydream\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1937\u0027\u0027, ‘The Terror from the Depths’\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"You have black \u0027\u0027nightdreams\u0027\u0027, I know, for I have sat by you as you slept and heard you talk and seen your terror, which would soon destroy you if you could recall it, as one night showed\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"romantic/sexual daydreams, romantic/sexual \u0027\u0027nightdreams\", \"priority\":4}]}, \"synonyms\":{}}");

	add("nightfall", "{\"term\":\"nightfall\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From \u0027\u0027 + \u0027\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The close of the day; the coming of night\", \"priority\":1}]}, \"synonyms\":{}}");

	add("nighthawk", "{\"term\":\"nighthawk\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{compound|night|hawk|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Image:Chordeiles thumb|right|A nighthawk\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A nightjar, especially\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A New World nightjar of the genus \u0027Chordeiles\u0027, especially\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1929\u0027\u0027, \u0027\u0027, Folio Society 2008, p. 91\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The swallows circled around and I watched them and the \u0027\u0027night-hawks\u0027\u0027 flying above the roofs and drank the Cinzano\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A person whose preference or custom is to remain awake and active during the night and the early morning hours\", \"priority\":6}]}, \"synonyms\":{}}");

	add("nightie", "{\"term\":\"nightie\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A woman\u0027s nightgown or nightdress; a dress-like garment worn to bed\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"I was too embarrassed to answer the door in my \u0027\u0027nightie\", \"priority\":2}]}, \"synonyms\":{}}");

	add("nightingale", "{\"term\":\"nightingale\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\"], \"text\":\"From Old english (ca. 450-1100) {{m|ang|nihtgale||one who sings during the night}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A European songbird, \u0027Luscinia megarhynchos\u0027, of the family Muscicapidae\", \"priority\":1}]}, \"synonyms\":{}}");

	add("nightlight", "{\"term\":\"nightlight\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From night + light\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"a small, dim light or lamp left on overnigh\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"He put a small \u0027\u0027nightlight\u0027\u0027 in the bathroom to find his way around in the dark\", \"priority\":2}]}, \"synonyms\":{}}");

